// Frontend code (React component)
import React, { useState, useEffect } from 'react';

function DisplayData() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://firebasestorage.googleapis.com/v0/b/myapp-7e111.appspot.com/o/value.json?alt=media&token=3ecb088e-b15a-4c75-a76a-5b31e3803ef2');
        const data = await response.json();
        console.log(data);
        setData([data]);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  if (data.length === 0) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <ul>
        {data.map((item, index) => (
          <div key={index}>
            <li>{item.material}</li>
            <li>{item.grade}</li>
            <li>{item.thickness}</li>
            <li>{item.comments}</li>
            <img src={item.image_url} alt="Image" />
          </div>
        ))}
      </ul>
    </div>
  );
}

export default DisplayData;
